package ir.gonabad.taskmanagment.framework.network.mapperimport ir.gonabad.core.domain.addCategory.AddCategoryResponseimport ir.gonabad.core.domain.addCategory.Resultimport ir.gonabad.core.domain.deleteUser.DeleteUserResponseimport ir.gonabad.taskmanagment.framework.network.entities.addCategory.AddCategoryResponseEntityimport ir.gonabad.taskmanagment.framework.network.entities.addCategory.ResultEntityimport ir.gonabad.taskmanagment.framework.network.entities.deleteUser.DeleteUserResponseEntityimport ir.gonabad.taskmanagment.framework.utils.EntityMapperimport javax.inject.Injectclass DeleteUserMapper @Inject constructor() : EntityMapper<DeleteUserResponseEntity , DeleteUserResponse> {    override fun mapFromEntity(entity: DeleteUserResponseEntity): DeleteUserResponse {        return DeleteUserResponse(            result = entity.result ,            status = entity.status        )    }    override fun mapToEntity(domainModel: DeleteUserResponse): DeleteUserResponseEntity {        return DeleteUserResponseEntity(            result = domainModel.result ,            status = domainModel.status        )    }}